struct CustomError(String); fn main() -> Result<(), CustomError> { let path = "test.txt"; let content = std::fs::read_to_string(path) .map_err(|err| CustomError(format!("Error reading `{}`: {}", path, err)))?; println!("file content: {}", content); Ok(())
