test check_answer_validity ... ok test result: ok. 1 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out Now that we've seen how we can write tests, we still need to figure out what to test. As you've seen it's fairly easy to write assertions for functions. But a CLI application is often more than one function! Worse, it often deals with user input, reads files, and writes output.

