Instead of setting a variable and having other parts of the program check it, you can use channels: You create a channel into which the signal handler emits a value whenever the signal is received. In your application code you use this and other channels as synchronization points between threads. Using crossbeam-channel it would look something like this: use std::time::Duration;
use crossbeam_channel::{bounded, tick, Receiver, select};
use anyhow::Result; fn ctrl_channel() -> Result<Receiver<()>, ctrlc::Error> { let (sender, receiver) = bounded(100); ctrlc::set_handler(move || { let _ = sender.send(()); })?; Ok(receiver)
} fn main() -> Result<()> { let ctrl_c_events = ctrl_channel()?; let ticks = tick(Duration::from_secs(1)); loop { select! { recv(ticks) -> _ => { println!("working!"); } recv(ctrl_c_events) -> _ => { println!(); println!("Goodbye!"); break; } } } Ok(())
}

