Tab-separated values is a simple way to output structured data but it requires the other program to know which fields to expect (and in which order) and it's difficult to output messages of different types. For example, let's say our program wanted to message the consumer that it is currently waiting for a download, and afterwards output a message describing the data it got. Those are very different kinds of messages and trying to unify them in a TSV output would require us to invent a way to differentiate them. Same when we wanted to print a message that contains two lists of items of varying lengths. Still, it's a good idea to choose a format that is easily parsable in most programming languages/environments. Thus, over the last years a lot of applications gained the ability to output their data in JSON . It's simple enough that parsers exist in practically every language yet powerful enough to be useful in a lot of cases. While its a text format that can be read by humans, a lot of people have also worked on implementations that are very fast at parsing JSON data and serializing data to JSON. In the description above, we've talked about "messages" being written by our program. This is a good way of thinking about the output: Your program doesn't necessarily only output one blob of data but may in fact emit a lot of different information while it is running. One easy way to support this approach when outputting JSON is to write one JSON document per message and to put each JSON document on new line (sometimes called Line-delimited JSON ). This can make implementations as simple as using a regular println!. Here's a simple example, using the json! macro from serde_json to quickly write valid JSON in your Rust source code: use clap::Parser;
use serde_json::json; /// Search for a pattern in a file and display the lines that contain it.
#[derive(Parser)]
struct Cli { /// Output JSON instead of human readable messages #[arg(long = "json")] json: bool,
} fn main() { let args = Cli::parse(); if args.json { println!( "{}", json!({ "type": "message", "content": "Hello world", }) ); } else { println!("Hello world"); }
} And here is the output: $ cargo run -q
Hello world
$ cargo run -q -- --json
{"content":"Hello world","type":"message"} (Running cargo with -q suppresses its usual output. The arguments after -- are passed to our program.)

