Let's say we have a program that reads the number of words in a file: use clap::Parser;
use std::path::PathBuf; /// Count the number of lines in a file
#[derive(Parser)]
#[command(arg_required_else_help = true)]
struct Cli { /// The path to the file to read file: PathBuf,
} fn main() { let args = Cli::parse(); let mut word_count = 0; let file = args.file; for line in std::fs::read_to_string(&file).unwrap().lines() { word_count += line.split(' ').count(); } println!("Words in {}: {}", file.to_str().unwrap(), word_count)
} It takes the path to a file, reads it line by line, and counts the number of words separated by a space. When you run it, it outputs the total words in the file: $ cargo run README.md
Words in README.md: 47 But what if we wanted to count the number of words piped into the program? Rust programs can read data passed in via stdin with the Stdin struct which you can obtain via the stdin function from the standard library. Similar to reading the lines of a file, it can read the lines from stdin. Here's a program that counts the words of what's piped in via stdin use clap::{CommandFactory, Parser};
use is_terminal::IsTerminal as _;
use std::{ fs::File, io::{stdin, BufRead, BufReader}, path::PathBuf,
}; /// Count the number of lines in a file or stdin
#[derive(Parser)]
#[command(arg_required_else_help = true)]
struct Cli { /// The path to the file to read, use - to read from stdin (must not be a tty) file: PathBuf,
} fn main() { let args = Cli::parse(); let word_count; let mut file = args.file; if file == PathBuf::from("-") { if stdin().is_terminal() { Cli::command().print_help().unwrap(); ::std::process::exit(2); } file = PathBuf::from("<stdin>"); word_count = words_in_buf_reader(BufReader::new(stdin().lock())); } else { word_count = words_in_buf_reader(BufReader::new(File::open(&file).unwrap())); } println!("Words from {}: {}", file.to_string_lossy(), word_count)
} fn words_in_buf_reader<R: BufRead>(buf_reader: R) -> usize { let mut count = 0; for line in buf_reader.lines() { count += line.unwrap().split(' ').count() } count
} If you run that program with text piped in, with - representing the intent to read from stdin, it'll output the word count: $ echo "hi there friend" | cargo run -- -
