使用現成的函式庫來實現參數的解析，這是更明智的選擇。 clap 是目前最受歡迎的解析命令列參數的函式庫。 它提供了所有你需要的功能， 如子指令、 自動補全 和完善的幫助資訊。 首先，我們需要在 Cargo.toml 檔案的 [dependencies] 欄位裡加入上 clap = { version = "4.0", features = ["derive"] } 來匯入 clap。 現在，我們可以在程式碼中加入use clap::Parser;, 和在先前建立的 struct Cli 的正上方加上 #[derive(Parser)]。 我們也可以在過程中編寫一些文件註解。 讓我們在這開始（在檔案 src/main.rs，fn main( ) { 之前 ）： use clap::Parser; /// Search for a pattern in a file and display the lines that contain it.
#[derive(Parser)]
struct Cli { /// The pattern to look for pattern: String, /// The path to the file to read path: std::path::PathBuf,
} 筆記: 你可以將許多自訂屬性加入到欄位中。 例如， 如果你想將 -o 或 --output 後的參數解析為某個字段，可在字段上方添加上 #[structopt(short = "o", long = "output")]。 如需更多屬性設置，請查看 clap documentation 。 在本範例中，我們的 Cli 結構體下方即是 main 函數。 當開始執行程式時，就會呼叫這個函數： fn main() { let args = Cli::parse(); println!("pattern: {:?}, path: {:?}", args.pattern, args.path)
} 這將嘗試解析參數並儲存到 Cli 結構體中。 但如果解析失敗會怎樣？ 這就是使用此方法的美妙之處：Clap 知道它需要什麼字段， 及所需字段的類型。 它可以自動產生一個不錯的 --help 訊息， 並會依錯誤給予一些建議－輸入的參數應該是 --output 而你輸入的是 --putput。 筆記: parse 方法應該在 main 函數中使用。 當它失敗時， 它將輸出錯誤或幫助訊息並立即退出該程式。 請勿在其他地方使用！
